window.bookSummaryJSON = "<p>The famous duo has been split! Watson has been banished from Holmes's company. Despite the interference of his horrible wife, Mary, Watson tirelessly insinuates himself into every magical adventure he can. </p> <p>Together, he and Holmes face a man with a twisted...everything, some very questionable juice-drinking Germans, Garrideb the Devourer and the estimable Irene Adler. Yet, nothing can prepare them for Moriarty's new form and the terrible moment they must face their Finality Problem at the edge of the Reichenbach Falls.</p> <p>Performed by Scott McCormick, Eric Messner, Kimberly Gilbert, Patrick Bussink, Colleen Delany, John Kielty, Earl Fisher, Bradley Foster Smith, Christopher Graybill, Kay Eluvian, Jenna Sharpe, Chris Davenport, Todd Scofield, Stewart Crank, Wyn Delano, Peter Holdway, Joey Sourlis, Michael John Casey, Andrew Colford, Danny Gavigan, Mort Shelby, Rose Elizabeth Supan, Terence Aselford, Alex Hill-Knight, Torian Brackett, Lucy Symons, Jacob Yeh, Nora Achrati, Lolita Horne and Jillian Levine-Sisson.</p>"; 
